import {Container, Nav, Navbar, Button} from 'react-bootstrap';
import { Link } from 'react-router-dom';
import './navbar.css'


const NavbarBook = () => {


  return (
    <nav className='my-navbar' expand="lg">
      <Container>
        <div className='playwrite-nz'><Link className='nav-link' to="/">.Ink</Link></div>
          <Nav className="me-auto">

          </Nav>

          <Nav className="justify-content-end align-items-center">
          <Link className='nav-link' to="/login"><button className='btn-ink-first'>Login</button></Link>
          <Link className='nav-link' to="/registrazione"><button className='btn-ink-second'>Registrati</button></Link>
          </Nav>
      </Container>
    </nav>
  );
}

export default NavbarBook;
